import { StyledBackdrop, StyledModalWindow } from "./ModalWindow.styled";

export const ModalWindowWraper = ({ children, closeWindow }) => {

  return (
    <StyledBackdrop onClick={closeWindow}>
      <StyledModalWindow>{children}</StyledModalWindow>
    </StyledBackdrop>
  );
};
